import axios from 'axios';

const DeckAPI = async (props) => {
  try {
    let res = await axios.get(
      'https://deckofcardsapi.com/api/deck/new/shuffle/?deck_count=14'
    );
    props.getDeckID(res.deck_id);
    return;
  } catch (err) {
    console.error(err);
  }
};

export default DeckAPI;
